import React from "react";

class Footer extends React.Component {
    render () {
        return (
            <div class="footer">
                <br/>
                <p>&copy; 2019 | 2022 GreenMedia | Erasmus+ FinalBuild </p>
            </div>
        );
    }
}

export default Footer;
